import React from 'react';
import logo from '../assets/idc-logo.jpg';

const Navbar = () => {
  return (
    <header className="navbar">
      <div className="nav-inner">
        <a href="/" className="brand">
          <img src={logo} alt="IDC" className="brand-logo" />
          <span>IDC</span>
        </a>
        <nav className="nav-links">
          <a href="/" className="nav-link">Home</a>
          <a href="/sponsors" className="nav-link">Sponsors</a>
          <a href="/membership" className="nav-link">Membership</a>
          <a href="/community" className="nav-link">Community</a>
        </nav>
        <a className="whatsapp-top-cta" href="https://chat.whatsapp.com/your-group-link" target="_blank" rel="noopener noreferrer">Join WhatsApp</a>
      </div>
    </header>
  );
};

export default Navbar;
